import React from 'react';

import Product from './Product';

const ProductsList = (props) => {
    return (
      <ul>
        {props.products.map((product) => (
          <Product
            key={product.title}
            title={product.title}
            price={product.price}
          />
        ))}
      </ul>
    );
  };

  export default ProductsList;
